import React from 'react';

const Block = (props) => {
    return (
        <div className="text-light d-flex flex-column align-item-center">

            <p className="text-uppercase fw-bold ">{props.title}</p>

            {

             props.mesCoordonee.map((item)=>{
                 return(
                    <div key={item.id}>
                        <i className={item.img} ></i>
                        <p>{item.value}</p>

                    </div>
                 )
             })


            }

        </div>
    );
};

export default Block;
